import axios from 'axios';
export default function Database(){

    const [data,setData] = useState([])

    useEffect(()=>{
        const getData = async ()=>{
            const response = await axios.get('http://localhost:8080/database')
            setData(response.data)
        }
        //getData()
    },[])

    return(
        <div>
            {data}
        </div>
    )
}
